package it.unibs.sandroide.lib.beacon.msg;

import org.altbeacon.beacon.Beacon;
import org.altbeacon.beacon.BeaconManager;
import org.altbeacon.beacon.BeaconParser;


public class BeaconMsgAltBeacon extends BeaconMsgBase {

    public static String PARSER_ID = "BeaconMsgAltBeacon";  // same as class name

    public static String MSG_LAYOUT = BeaconParser.EDDYSTONE_URL_LAYOUT;
    public static String MSG_TYPECODE = "beac";

    public BeaconMsgAltBeacon(Beacon b) {
        super(b);
    }

    @Override
    public BeaconMsgBase parse() {
        if (!this.MSG_TYPECODE.toUpperCase().equals(Long.toHexString(this.getBeaconTypeCode()).toUpperCase())) {
            return null;
        }
        // Note: Here you can put your code to parse message data fields into convenient instance class variables
        return this;

    }

    public static void initLayout(BeaconManager mgr) {
        mgr.getBeaconParsers().add(new BeaconParser(PARSER_ID)
                .setBeaconLayout(MSG_LAYOUT));
    }


    @Override
    public String getImage() {
        return BASE64_IMAGE;
    }

    private static String BASE64_IMAGE = "";

}
